import React from 'react';
import ReactDOM from 'react-dom';

function App(props){
    return (
      <div className='comment'>
        <UserInfo user={props.author} />
        <CommentData comment={props.commentData} />
      </div>
    )
}

ReactDOM.render(
  <App
  />,
    document.getElementById('root')
);
